import React from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';

const ServicesGrid = () => {
  const services = [
    { name: 'Interior Painting', link: '/interior-painting' },
    { name: 'Furniture Assembly', link: '/furniture-assembly' },
    { name: 'Office Cleaning', link: '/office-cleaning' },
    { name: 'Moving Help', link: '/moving-help' },
    { name: 'Handyman Service', link: '/handyman-service' },
    { name: 'TV Mounting', link: '/tv-mounting' },
    { name: 'Home Cleaning', link: '/home-cleaning' },
    { name: 'Hanging Pictures & Shelves', link: '/hanging-pictures-shelves' },
    { name: 'Contactless Pick-up/Delivery', link: '/contactless-delivery' },
  ];

  return (
    <Container className="my-5">
      <Row xs={1} sm={2} md={3} className="g-4">
        {services.map((service, index) => (
          <Col key={index}>
            <Card as="a" href={service.link} className="h-100 text-center text-decoration-none">
              <Card.Body className="d-flex align-items-center justify-content-center">
                <Card.Title className="mb-0 text-dark">{service.name}</Card.Title>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default ServicesGrid;
